webpackJsonp([0x8499045fb773],{996:function(e,t){e.exports={data:{wordpressPost:{title:"New Makeup Palettes So Pretty That You&#8217;ll Want (NEED) Them All",content:'<p>What is it about a palette? There&#8217;s no answer of course. The appeal of the palette simply can&#8217;t be defined. That said, we can throw a few reasons out there.</p>\n<p>We love them because they&#8217;re practical. They house a collection of makeup which we can keep tucked in our handbag or cosmetics drawer and utilise any time we wish. We also love them because they often come with a handy mirror meaning touch-ups are dead simple.</p>\n<p>And here&#8217;s the main reason &#8211; we love them because they&#8217;re pretty  &#8211; so pretty. Especially this lot. Scroll down and read why.</p>\n<img class="alignnone size-medium wp-image-3270" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30180021/Up-In-Lights-Open2-300x300.jpg" alt="" width="300" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30180021/Up-In-Lights-Open2-300x300.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30180021/Up-In-Lights-Open2-150x150.jpg 150w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30180021/Up-In-Lights-Open2-768x768.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30180021/Up-In-Lights-Open2-1024x1024.jpg 1024w" sizes="(max-width: 300px) 100vw, 300px" />\n<p><a href="https://www.dbcosmetics.com.au/locator">Designer Brands Up In Lights Highlight Kit, $14.99.</a></p>\n<p>This face palette contains highlighting shades to create a healthy glow. It contains rose, peach, champagne and gold tone and each shade applies easily and blends like a dream. Plus that price! Perfect.</p>\n<p>&nbsp;</p>\n<img class="alignnone size-medium wp-image-3279" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01122810/JPG-Peach-294x300.jpg" alt="" width="294" height="300" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01122810/JPG-Peach-294x300.jpg 294w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01122810/JPG-Peach-768x784.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01122810/JPG-Peach.jpg 885w" sizes="(max-width: 294px) 100vw, 294px" />\n<p><a href="http://www.mecca.com.au/too-faced/sweet-peach-glow-peach-infused-highlighting-palette/I-025952.html?cgpath=brands#q=too+faced&amp;start=1">Too Faced Peach Glow Peach-Infused Highlighting Palette, $61.</a></p>\n<p>The Too Faced obsession continues with the latest offering in the highly coveted peach empire: a highlighting, blushing and bronzing complexion palette injected with the essence of juicy peach. The pigment is rich, as you&#8217;d expect from Too Faced, which always produces the best quality makeup. And look at it the absolute adorableness of it! We can&#8217;t even. No really &#8211; we can&#8217;t.</p>\n<p>&nbsp;</p>\n<img class="alignnone size-medium wp-image-3268" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30173740/JPG-Chantecaille-300x260.jpg" alt="" width="300" height="260" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30173740/JPG-Chantecaille-300x260.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30173740/JPG-Chantecaille-768x665.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/09/30173740/JPG-Chantecaille.jpg 921w" sizes="(max-width: 300px) 100vw, 300px" />\n<p><a href="http://www.mecca.com.au/chantecaille/save-the-forest-eye-palette/I-028489.html?cgpath=whatsnew#start=1">Chantecaille Save The Forest Eye Palette, $124.</a></p>\n<p>Inspired by the incredible beauty of Virunga National Park in Africa, home to some of the last remaining gorillas on the planet, this palette is heaven. Shades are not only super pigmented and creamy but in the most crazy flattering shades that will suit all colourings. It&#8217;s a limited edition so best hurry. And if you need an excuse for the spend how about this one &#8211; a portion of all profits will be donated to the National Park in order to keep those gorillas safe and sound. Win win!</p>\n<img class="alignnone size-medium wp-image-3282" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01123545/JPG-Hourglass--300x164.jpg" alt="" width="300" height="164" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01123545/JPG-Hourglass--300x164.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01123545/JPG-Hourglass--768x420.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01123545/JPG-Hourglass-.jpg 890w" sizes="(max-width: 300px) 100vw, 300px" />\n<p><a href="http://www.mecca.com.au/hourglass/ambient-lighting-palette/I-017068.html?cgpath=brands-hour#start=1">Hourglass Ambient Lighting Palette, $90.</a></p>\n<p>Create a perfected, multi-dimensional complexion with a soft focus, luminous finish using this game-changing palette for setting powders. Its creators say it&#8217;s developed using ground-breaking Photoluminescent Technology. Now, we have no idea what that is, but the fact is it does truly blur imperfections and give skin a dead lovely candlelit glow. Love that. Universally flattering, this wardrobe of finishing powders is suitable for all skin types and tones.</p>\n<p>&nbsp;</p>\n<img class="alignnone size-medium wp-image-3275" src="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01121520/JPG-By-Terry-300x267.jpg" alt="" width="300" height="267" srcset="http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01121520/JPG-By-Terry-300x267.jpg 300w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01121520/JPG-By-Terry-768x683.jpg 768w, http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01121520/JPG-By-Terry.jpg 900w" sizes="(max-width: 300px) 100vw, 300px" />\n<p><a href="http://www.mecca.com.au/by-terry/eye-designer-palette-parti-pris/V-026041.html?cgpath=whatsnew#sz=36&amp;start=217">By Terry Eye Designer Palette Parti-Pris, $80.</a></p>\n<p>Say hello to your new love &#8211; six ultra-blendable shadows. There&#8217;s three colour families but this one, dubbed Gem Experience, is our favourite for a bold, statement effect. Composed of ultra-fine powders, each shade blends seamlessly, delivers high-impact colour and adorns lids with the perfect amount of sheen. Captured in a sleek purple case, featuring a mirrored lid for ultimate convenience.</p>\n',better_featured_image:{source_url:"http://dcqiwphk5imn5.cloudfront.net/wp-content/uploads/2017/10/01122810/JPG-Peach.jpg"},categories:[{slug:"makeup",name:"Makeup"}]},site:{siteMetadata:{title:"The Beauty Insider"}}},pathContext:{id:"404efe26-735f-5bec-8406-50238478e6f3"}}}});
